import {CREATE_ROOM} from "../actions";

const roomState = (state = [], action) => {
    switch (action.type) {
        case CREATE_ROOM:
            return [
                ...state,
                        {

                            host: "HOST NAME",
                            game: "GAME NAME"
                        }
                    ]
        default:
            return state;
    }
}

export default roomState;
